// src/pages/myPage/myPage_menu.js
import React from 'react';
import '../../css/myPage/myPage_menu.css';

function MyPageMenu() {
  return (
    <div className="mypage-menu">
      <h2 className="section-title">거래 정보</h2>
      <ul className="menu-list">
        <li>판매내역</li>
        <li>구매내역</li>
        <li>택배</li>
        <li>찜한 상품</li>
      </ul>
      <hr className="divider" />
      <h2 className="section-title">내 정보</h2>
      <ul className="menu-list">
        <li>계좌 관리</li>
        <li>배송지 관리</li>
        <li>거래 후기</li>
        <li>탈퇴하기</li>
      </ul>
    </div>
  );
}

export default MyPageMenu;
